import { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import CountrySearchForm from "app/components/CountrySearchForm";
import CountryList from "app/components/CountryList";
import Navbar from "app/components/Navbar";
import { Routes } from "./utils/enums/routes";

export interface CountriesData {
  name: string;
  alpha2Code: string;
  capital: string;
  population: number;
  latlng: number[];
  flag: string;
}

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route exact path="/" component={CountrySearchForm} />
          <Route exact path={Routes.CountriesByName} component={CountryList} />
          <Redirect path="*" to="/" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
